import React from "react";
import Particles from "react-particles-js";

function ParticlesBackground()  {

    return (
    <div
        style={{
        position: "absolute",
        top: 0,
        left: 0,
        width: "100%",
        height: "100%"
        }}>
         <Particles
        height={window.outerHeight}
        params={{
            "particles": {
                "number": {
                    "value": 150
                },
                "size": {
                    "value": 3,
                    "random": true,

                },
                "color": {
                    "value": "#e51a94"
                },

                "shape": {
                "type": "circle",

                "image": {
                    "src": "https://raw.githubusercontent.com/EMDevelop/images/main/Mobile-Phone-icon.png",
                    "width": 100,
                    "height": 100,
                    },   
                },

                "line_linked": {
                    "enable": true,
                    "distance": 100,
                    "color": "#e51a94",
                    "opacity": .6,
                    "width": 1
                },
            },
                "interactivity": {
                    "events": {
                        "onhover": {
                            "enable": false,
                            "mode": "bubble"
                        }
                    }
                }
        }} />
        </div>
        )
    };

 export default  ParticlesBackground;
